import React from 'react';
import './Interior.css';
import { FaShoppingCart, FaUser } from 'react-icons/fa';
import couchImage from '../../assets/Studio-design/couch.png'; 
import Crafted from '../Crafted-material/Crafted';

function Interior() {
  const [hoveredIndex, setHoveredIndex] = React.useState(null);

  const handleImageHover = (index) => {
    setHoveredIndex(index);
  };

  const handleImageLeave = () => {
    setHoveredIndex(null);
  };

  return (
    <div>
      <nav className="navbar">
        <div className="left-side">
          <a href="#home" className="brand">Furni</a>
        </div>
        <div className="right-side">
          <ul className="nav-links">
            <li><a href="#home">Home</a></li>
            <li><a href="#shop">Shop</a></li>
            <li><a href="#about">About us</a></li>
            <li><a href="#services">Services</a></li>
            <li><a href="#blog">Blog</a></li>
            <li><a href="#contact">Contact us</a></li>
          </ul>
          <div className="icons">
            <a href="#cart"><FaShoppingCart /></a>
            <a href="#user"><FaUser /></a>
          </div>
        </div>
      </nav>

      <div className="content">
        <div className="left-box">
          <h2>Modern Interior Design Studio</h2>
          <p>Donec vitae odio quis nisl dapibus malesuada. Nullam ac aliquet velit. Aliquam vulputate velit imperdiet dolor tempor tristique.</p>
          <div className="buttons">
            <button className="btn">Learn More</button>
            <button className="btn">Contact Us</button>
          </div>
          <Crafted />
        </div>
        <div className="right-box">
          <div className="image-box">
            {[1, 2, 3].map((index) => (
              <div
                key={index}
                className="image-container"
                onMouseEnter={() => handleImageHover(index)}
                onMouseLeave={handleImageLeave}
              >
                <img src={couchImage} alt={`Image ${index}`} />
                {hoveredIndex === index && (
                  <div className="icon-container">
                    <FaShoppingCart />
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Three boxes below */}
      <div className="three-boxes">
        <div className="box">
          <h3>Box 1</h3>
          <p>Crafted with excellent material. Donec vitae odio quis nisl dapibus malesuada. Nullam ac aliquet velit. Aliquam vulputate velit imperdiet dolor tempor tristique.</p>
        </div>
        <div className="box">
          <h3>Box 2</h3>
          {/* Add content or image here */}
        </div>
        <div className="box">
          <h3>Box 3</h3>
          {/* Add content or image here */}
        </div>
      </div>
    </div>
  );
}

export default Interior;
